import { useNavigate } from "react-router-dom";
import React, { useCallback } from "react";
import fotoOferta from "https://http2.mlstatic.com/D_NQ_NP_649489-MLC44497579743_012021-O.jpgg";
import {
  FormUsuarioComponent,
  TableUsuarioComponent,
  ButtonComponents,
} from "../components";

const OfertaTrucha = () => {
  const navigate = useNavigate();
  const homeOnclick = useCallback(() => navigate("/Home", {}, [useNavigate]));
  return (
    // <div style={
    //     { backgroundImage: `url(${background})` };
    //     { background-repeat: `no-repeat`        };
    //     }>
    <div>
      <img
        src={fotoOferta}
        alt="aaa"
        style={{
          position: "absolute",
          zIndex: -1,
          width: "100%",
          height: "220%",
          // backgroundPosition:
          // backgroundRepeat:
          // backgroundSize:
          // backgroundRepeat:
          // backgroundAttachment:
        }}
      />

      <br />
      <div class="d-flex justify-content-center">
        <h1>
          {" "}
          OPORTUNIDAD UNICA, COMPRE SU VOLVO FMX POR SOLO $100.000.000.000!{" "}
        </h1>
      </div>
      <br />
      <br />
      <div class="d-flex justify-content-center">
        <div class="d-flex flex-row-reverse">
          <ButtonComponents infoBoton={"Ir a Home"} homeOnclick={homeOnclick} />
        </div>
      </div>
    </div>
  );
};
export default OfertaTrucha;
